    false,nt"url": null,nt"notes": "Benthic habitat polygon coverages are being
    created for the Olympic Coast national marine sanctuary (OCNMS). ROV, towed camera
    sled, bathymetry data, sedimentary samples, and sonar mapping have been integrated
    to describe the geological, biological, and oceanographic aspects of habitat. OCNMS
    has collected multibeam backscatter, multibeam bathymetry, bottom grab and video
    data to produce polygon coverages describing the benthic habitat for survey HMPR-114-2004-02c.
    The habitat polygons have attributes for megahabitat, bottom induration, mesohabitat,
    macrohabitat and biology (where direct observations are available),polygon area
    and perimeter.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
